uint32_t p1In=0;//inpit from player 1
uint32_t p2In=0;//input from player 2
int color=-1;	//color code for win condition
uint32_t p1Cool=0;	//cooldown if wrong button pressed
uint32_t p2Cool=0;	//^^
uint32_t Data;        // 12-bit ADC
int title=1;	//press button to start flag
int gameOver=1;

void Sound_Death(void);
void Sound_Battle(void);
void Sound_Winning(void);
void Sound_Background(void);
// *************************** Capture image dimensions out of BMP**********
void Port_Init(void){volatile unsigned long delay;
	SYSCTL_RCGC2_R |= 0x31;
	delay = SYSCTL_RCGC2_R;
  GPIO_PORTF_LOCK_R = 0x4C4F434B;   // 2) unlock GPIO Port F
	GPIO_PORTF_CR_R = 0x1F;						//unlock ports
  GPIO_PORTF_AMSEL_R &= ~0x0F;        // 3) disable analog on PF3-0
  GPIO_PORTF_PCTL_R &= ~0x0F;   // 4) PCTL GPIO on PF3-0
  GPIO_PORTF_DIR_R &= 0x0F;          // 5) PF3-0 in
  GPIO_PORTF_AFSEL_R &= ~0x0F;        // 6) disable alt funct on PF3-0
  GPIO_PORTF_DEN_R |= 0x0F;          // 7) enable digital I/O on PF3-0
	
			
  GPIO_PORTE_AMSEL_R &= ~0x0F;    //same thing 
  GPIO_PORTE_PCTL_R &= ~0x0F;   
  GPIO_PORTE_DIR_R &= 0x0F;       
  GPIO_PORTE_AFSEL_R &= ~0x0F;    
  GPIO_PORTE_DEN_R |= 0x0F;       
}

void winCondition(int player){
	if(player==2){
	ST7735_DrawBitmap(77,148,samuraidie,49,49);
		ST7735_DrawBitmap(2,145,eraseninja,29,45);
		ST7735_DrawBitmap(34,79,ninwin,64,22);
	}
	if(player==1){
	ST7735_DrawBitmap(0,145,ninjadie,59,45);
		ST7735_DrawBitmap(85,148, erasesamurai,39,47);
		ST7735_DrawBitmap(34,79,samwin,64,22);
	}	
	Sound_Death();
	Sound_Winning();
	Delay100ms(30);
	gameOver=0;
	Sound_Background();
	return;
}
void buttonPressed(int p1, int p2){
		if(color==3)
			color=4; //lazy fix for input
		if(p1==color&&p1Cool==0)
			winCondition(1);
		else if(p1!=color&&p1!=0)
			p1Cool=1000000;
		if(p2==color&&p1Cool==0)
			winCondition(2);
		else if(p2!=color&&p2!=0)
			p2Cool=1000000;
		return;

}

